import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Profile.css';
import '@fortawesome/fontawesome-free/css/all.min.css';


const PublicProfile = () => {
  const navigate = useNavigate();

  const handleEditProfile = () => {
    navigate('/edit-profile'); // This should be the route for UserProfile.js
  };


  return (
    <div className="public-profile-container">
      <div className="cover-photo-container">
        <img src="cover-photo.jpg" alt="Cover" className="cover-photo" />
      </div>
      <i
        className="fas fa-edit edit-profile-icon"
        onClick={handleEditProfile}
        title="Edit Profile"
      ></i>
      <div className="profile-photo-container">
        <img src="profile-photo.jpg" alt="Profile" className="profile-photo" />
      </div>
      <div className="personal-info-container">
        <h2>John Doe</h2>
        <p><strong>Email:</strong> john.doe@example.com</p>
        <p><strong>Phone:</strong> 123-456-7890</p>
        <p><strong>Bio:</strong> This is a brief bio about John Doe.</p>
      </div>
    </div>
  );
};

export default PublicProfile;
